import React, { useContext } from "react";
import logo from "../img/logo.png";
import "./Navbar.css";
import { Link } from "react-router-dom";

export default function Navbar({ login }) {
  return (
    <div className="navbar">
      <img src={logo} alt="" />
      <ul className="nav-menu">
        <Link to="/"> <li>
            Home
        </li></Link>

        <li>
            Profile
        </li>
        <li>
            Logout
        </li>
      </ul>
    </div>
  );
}
